WATCHERS 8 continues with the unwrapping of a baby mummy skull in Paracas Peru, and what we find shocked all of us. Other segments in WATCHERS 8 we're keeping to ourselves at the moment, but please enjoy the trailer below.Our long time friend and associate, Dr. Roger Leir, passed away March 14th 2014. He was a big part of the entire WATCHERS series, and will be in Watchers 8.
